import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <label>아이디</label>
        <input type = "text"></input><br></br>
        <label>패스워드</label>
        <input type = "password"></input><br></br>
        <label>이름</label>
        <input type = "text"></input><br></br>
        <label>전화번호</label>
        <input type = "number"></input><br></br>
        <label>이메일</label>
        <input></input><br></br>
        <button>수정</button>
        <button>삭제</button>
      </header>
    </div>
  );
}

export default App;
